import React, { useState } from "react";
import { View, Text, Alert, StyleSheet, SafeAreaView } from "react-native";
// import {Picker} from '@react-native-picker/picker';
import RNPickerSelect from 'react-native-picker-select';

export default class PickerBatiments extends React.Component {
    constructor(props) {
        super(props);

        this.inputRefs = {};

        this.state = {
            BatName: undefined,
            items: [
                {
                    label: 'Aucun',
                    value: 'Aucun',
                },
                {
                    label: 'Alexandra Davis Neel',
                    value: 'Alexandra Davis Neel',
                },
                {
                    label: 'Albert Camus',
                    value: 'Albert Camus',
                },
                {
                    label: "Bois de l'étang",
                    value: "Bois de l'étang",
                },
                {
                    label: 'Clément Ader',
                    value: 'Clément Ader',
                },
                {
                    label: 'Copernic',
                    value: 'Copernic',
                },
                {
                    label: 'ESIEE',
                    value: 'ESIEE',
                },
                {
                    label: 'IUT',
                    value: 'IUT',
                },
                {
                    label: 'Lavoisier',
                    value: 'Lavoisier',
                },

                {
                    label: 'Pont & Chaussées',
                    value: 'Pont & Chaussées',
                },






            ],
        };
    }



    render() {


        return (

            <SafeAreaView style={styles.container}>

                <RNPickerSelect
                    placeholder={{
                        label: 'Choisis ton batiment',
                        value: null,
                    }}
                    items={this.state.items}
                    onValueChange={(value) => {
                        this.setState({
                            BatName: value,
                        });
                    }}

                    style={{ ...pickerSelectStyles }}
                    value={this.state.BatName}
                    ref={(el) => {
                        this.inputRefs.picker = el;
                    }}
                />


            </SafeAreaView>

        );
    }


}


const styles = StyleSheet.create({
    container: {

        paddingTop: 40,
        alignItems: "center"
    }
});
const pickerSelectStyles = StyleSheet.create({
    inputIOS: {
        marginTop: 5,
        fontSize: 16,
        paddingTop: 13,
        paddingHorizontal: 10,
        paddingBottom: 12,
        borderWidth: 3,
        borderColor: '#4D3D64',
        borderRadius: 30,
        backgroundColor: 'white',
        color: 'black',
    },
});
